function D2D_RectBox(b,d,c,a){this.x=b;this.y=d;this.width=c;this.height=a;this.originX=0;this.originY=0;}D2D_RectBox.prototype.draw=function(d,b,a){var c=d.getContext();c.save();if(b!=undefined){c.strokeStyle=b;}else{c.strokeStyle="#0000FF";}if(a!=undefined){c.lineWidth=a;}else{c.lineWidth=1;}c.strokeRect(this.x-this.originX,this.y-this.originY,this.width,this.height);c.restore();};D2D_RectBox.prototype.dispose=function(){this.x=null;this.y=null;this.width=null;this.height=null;this.originX=null;this.originY=null;};D2D_RectBox.prototype.setOrigin=function(b,a){this.originX=b;this.originY=a;};D2D_RectBox.prototype.getOriginX=function(){return this.originX;};D2D_RectBox.prototype.getOriginY=function(){return this.originY;};D2D_RectBox.prototype.getPosX=function(){return this.x;};D2D_RectBox.prototype.getPosY=function(){return this.y;};D2D_RectBox.prototype.getWidth=function(){return this.width;};D2D_RectBox.prototype.getHeight=function(){return this.height;};D2D_RectBox.prototype.setPosition=function(a,b){this.x=a;this.y=b;};D2D_RectBox.prototype.setSize=function(b,a){this.width=b;this.height=a;};D2D_RectBox.prototype.testPoint=function(a,b){return(a>=this.x-this.originX&&a<=this.x-this.originX+this.width&&b>=this.y-this.originY&&b<=this.y-this.originY+this.height);};D2D_RectBox.prototype.testRect=function(a){return(Math.abs((this.x-this.originX+this.width/2)-(a.x-a.originX+a.width/2))<=this.width/2+a.width/2&&Math.abs((this.y-this.originY+this.height/2)-(a.y-a.originY+a.height/2))<=this.height/2+a.height/2);};